import React, {useState} from 'react';

const MyInput = () => {
    const [value, setValue] = useState('')

    return (
        <div>
            <h1>Text input: {value}</h1>
            <input type="text"
                   value={value}
                   onChange={event => setValue(event.target.value)}
            />
        </div>
    );
};

export default MyInput;
